"use strict";(self.webpackChunkkywk_moco=self.webpackChunkkywk_moco||[]).push([[1555],{8125:function(n){n.exports=JSON.parse('{"blogPosts":[{"id":"/2022/06/05/notes","metadata":{"permalink":"/moco/blog/2022/06/05/notes","source":"@site/blog/2022/06-05-notes.md","title":"Journal","description":"2002.06.06 journal","date":"2022-06-05T00:00:00.000Z","formattedDate":"2022\u5e746\u67085\u65e5","tags":[{"label":"docusaurus","permalink":"/moco/blog/tags/docusaurus"}],"readingTime":0,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Journal","description":"2002.06.06 journal","authurs":"kywk","tags":["docusaurus"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":true},"nextItem":{"title":"Hello Docusaurus","permalink":"/moco/blog/2022/05/20/move-to-docusaurus"}},"content":""},{"id":"/2022/05/20/move-to-docusaurus","metadata":{"permalink":"/moco/blog/2022/05/20/move-to-docusaurus","source":"@site/blog/2022/05-20-move-to-docusaurus.md","title":"Hello Docusaurus","description":"Why move to Docusaurus.","date":"2022-05-20T00:00:00.000Z","formattedDate":"2022\u5e745\u670820\u65e5","tags":[{"label":"docusaurus","permalink":"/moco/blog/tags/docusaurus"}],"readingTime":3.555,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Hello Docusaurus","description":"Why move to Docusaurus.","authurs":"kywk","tags":["docusaurus"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":true},"prevItem":{"title":"Journal","permalink":"/moco/blog/2022/06/05/notes"},"nextItem":{"title":"\u7cfb\u7d71\u5b89\u88dd\u7d00\u9304","permalink":"/moco/blog/2021/02/28/mac_apps"}},"content":"\u5728 [PJCHENder \u672a\u6574\u7406\u7b46\u8a18](https://pjchender.dev/) \u770b\u5230 [Docusaurus](https://docusaurus.io/) \u9019\u5957 CMS.\\n\u67e5\u4e86\u4e00\u4e0b\u624d\u77e5\u9053\u539f\u4f86\u662f Facebook \u63a8\u51fa, \u9069\u7528\u65bc\u5c08\u6848\u6587\u4ef6\u7684\u975c\u614b\u7db2\u7ad9\u751f\u6210\u6846\u67b6.\\n\\n\u6bd4\u8d77\u4e00\u7bc7\u7bc7\u7368\u7acb\u6587\u7ae0\u7684\u90e8\u843d\u683c\u7cfb\u7d71, \u89ba\u5f97 Docusaurus \u66f4\u9069\u5408\u5fc3\u5f97\u7b46\u8a18\u6574\u7406\u7528. \\n\u525b\u597d\u539f\u672c\u4f7f\u7528\u7684 Hugo Theme \u4e0d\u5408\u9069, \u6b63\u5728\u627e\u65b0\u4e3b\u984c, \\n\u8a66\u7528\u5f8c, \u6c7a\u5b9a\u8f49\u5f80 Docusaurus \u91cd\u65b0\u5efa\u69cb. \\n\\n\x3c!--truncate--\x3e\\n\\n__\u6c7a\u5b9a\u8f49\u63db\u7cfb\u7d71\u4e3b\u56e0\u6709\u5e7e\u9ede__\\n\\n1.  \u90e8\u843d\u683c\u7cfb\u7d71\u504f\u5411\u4e00\u7bc7\u7bc7\u7368\u7acb\u6587\u7ae0, \u6587\u7ae0\u5f7c\u6b64\u9023\u7d50\u6027\u4e0d\u5f37\u70c8, \u7d50\u69cb\u4e5f\u4e0d\u6e05\u695a. \\n    \u800c\u5fc3\u5f97\u7b46\u8a18\u8a72\u6709\u7684\u7d50\u69cb\u95dc\u4fc2, \u900f\u904e\u90e8\u843d\u683c\u7cfb\u7d71\u52a0\u4e0a `catelogy` `tag` ... \u7b49\u8f14\u52a9, \\n    \u96d6\u52c9\u5f37\u53ef\u7528\u4f46\u4e0d\u76e1\u5982\u4eba\u610f.\\n2.  \u5fc3\u5f97\u7b46\u8a18\u6703\u4e0d\u6642\u66f4\u65b0, \u800c\u90e8\u843d\u683c\u7cfb\u7d71\u4ee5\u65e5\u671f\u70ba\u4e3b\u7684\u6587\u7ae0\u9673\u5217\u65b9\u5f0f, \u5c0d\u7b46\u8a18\u6574\u7406\u610f\u7fa9\u4e0d\u5927. \\n3.  Docusaurus \u539f\u751f\u5c08\u6ce8\u65bc\u5c08\u6848\u6587\u4ef6, \u5c0d\u65bc\u7a0b\u5f0f\u8a9e\u8a00\u5448\u73fe\u76f8\u7576\u53cb\u5584. \\n    \u5074\u908a\u6b04 / \u6587\u7ae0\u4e3b\u9ad4 / TOC \u57fa\u790e\u7248\u9762\u6e05\u695a\u660e\u77ad. \u5fc3\u5f97 CMS \u5f88\u5408\u9069.\\n4.  Docusaurus \u6709\u9650\u5ba2\u88fd\u5316, \u7121\u9808\u82b1\u8cbb\u904e\u591a\u6642\u9593\u8abf\u6574\u7248\u9762, \u53ef\u5c08\u6ce8\u65bc\u6587\u4ef6\u5167\u5bb9\u7de8\u5beb.\\n5.  Docusaurus \u6709 Blog \u652f\u63f4, \u7b46\u8a18\u6587\u4ef6\u653e `docs`, \u65e5\u5e38\u6587\u7ae0\u653e `blog`.\\n    \u7b46\u8a18\u6587\u4ef6\u548c\u90e8\u843d\u683c\u6587\u7ae0\u53ef\u4ee5\u6e05\u695a\u5206\u5272. \\n\\n\u7576\u6642\u5f9e Hexo \u63db\u5230 Hugo \u4e3b\u56e0\u662f\u5feb! Hugo \u751f\u6210\u901f\u5ea6\u9060\u5feb\u65bc Hexo. \\n\u800c\u73fe\u5728\u537b\u5f9e Hugo \u63db\u5230\u6bd4 Hexo \u66f4\u6162\u7684 Docusaurus. \\n\u9664\u4e86\u4e0a\u8ff0\u512a\u9ede\u5916, \u900f\u904e `GitHub Action`, \u8b93\u7db2\u7ad9\u751f\u6210\u5de5\u4f5c\u4ea4\u7531 GitHub \u8655\u7406, \u901f\u5ea6\u5c31\u4e0d\u518d\u662f\u554f\u984c.\\n\\n\u5b98\u65b9\u8aaa\u660e\u5f88\u6e05\u695a, \u7db2\u8def\u4e0a\u6587\u7ae0\u4e5f\u591a, \u57fa\u790e\u8f49\u79fb\u6c92\u9047\u5230\u554f\u984c. \\n\u5012\u662f\u500b\u4eba\u4e00\u4e9b\u7279\u6b8a\u9700\u6c42, \u8a66\u4e86\u4e00\u4e0b\u624d\u89e3\u6c7a.\\n\\n__Obsidian__\\n\\n\u6211\u7684 Markdown \u6587\u4ef6\u90fd\u653e\u5728 Obsidian Vault \u4e0b, \u85c9\u7531 Obsidian \u4f86\u5efa\u69cb\u7b46\u8a18\u8cc7\u6599\u5eab.\\nHugo \u6846\u67b6\u53ef\u4ee5\u900f\u904e symbolic link \u9023\u7d50\u5230 Obsidian \u4e0b\u7684\u76ee\u9304, \u800c Docusaurus \u5247\u6703\u5831\u932f.\\n\\n\u9084\u597d Obsidian \u6709 [Symbolic links](https://forum.obsidian.md/t/symbolic-links-symlinks-folder-links/1058) \u9700\u6c42\u7684\u4eba\u4e0d\u5c11,\\n\u900f\u904e [symlinks-obsidian](https://github.com/chrisdmacrae/symlinks-obsidian/) plugin \\n\u53ef\u4ee5\u8b93 Obsidian Vault \u4e0b\u7684 symbolic link \u6b63\u5e38\u5de5\u4f5c.\\n\\n\u5982\u6b64, \u53cd\u5176\u5411\u800c\u884c. \\n\u6587\u4ef6\u653e\u65bc Docusaurus \u5de5\u4f5c\u76ee\u9304\u4e0b, \u5728 Obsidian Vault \u4e0b\u5efa\u7acb symbolic link \u9023\u7d50\u904e\u53bb.\\nDocusaurus / Obsidian \u90fd\u53ef\u4ee5\u6b63\u5e38\u904b\u884c.\\n\\n__node_modules__\\n\\n\u9019\u4e5f\u662f\u4e00\u822c\u60c5\u6cc1\u4e0d\u6703\u767c\u751f, \u500b\u4eba\u7fd2\u6163\u884d\u751f\u7684\u554f\u984c.\\n\\n\u6211\u7684 Docusaurus \u5de5\u4f5c\u76ee\u9304\u653e\u5728 Dropbox \u540c\u6b65, \u70ba\u4e86\u7bc0\u7701\u7a7a\u9593, \\n\u6703\u628a `node_modules` \u79fb\u5230\u672c\u6a5f\u76ee\u9304\u5f8c, \u5efa\u7acb symbolic link \u9023\u7d50.\\n\\n\u767c\u73fe\u6709\u8da3\u7684\u662f, \u66f4\u6539 `node_modules` \u540d\u7a31\u5f8c, \u5efa\u7acb\u7684 symbolic link \u6703\u51fa\u932f:\\n\\n``` shell\\n[~/Dropbox/mySite] $ mv node_modules ~/node_modules/Docusaurus\\n[~/Dropbox/mySite] $ ln -sfF ~/node_modules/Docusaurus node_modules\\n[~/Dropbox/mySite] $ npm start\\n\\nnode:internal/errors:465\\n    ErrorCaptureStackTrace(err);\\n    ^\\n\\nError [ERR_MODULE_NOT_FOUND]: Cannot find package \'@docusaurus/logger\' imported from /home/kywk/project/node_modules/Docusaurus/doc/@docusaurus/core/bin/docusaurus.mjs\\n  ...\\n  code: \'ERR_MODULE_NOT_FOUND\'\\n}\\n```\\n\\n\u800c\u82e5\u7dad\u6301 `node_modules` \u8cc7\u6599\u593e\u540d\u7a31, \u5247\u4e0d\u6703\u5831\u932f:\\n\\n``` shell\\n[~/Dropbox/mySite] $ mv node_modules ~/Docusaurus/node_modules/\\n[~/Dropbox/mySite] $ ln -sfF ~/Docusaurus/node_modules\\n[~/Dropbox/mySite] $ npm start\\n\\n[INFO] Starting the development server...\\n[SUCCESS] Docusaurus website is running at http://localhost:3000/moco/.\\n```\\n\\nDocusaurus \u6162\u6162\u63a2\u7d22\u642c\u4e2d. \u521d\u6b65\u5370\u8c61, 85 \u5206!"},{"id":"/2021/02/28/mac_apps","metadata":{"permalink":"/moco/blog/2021/02/28/mac_apps","source":"@site/blog/2021/02-28-mac_apps.md","title":"\u7cfb\u7d71\u5b89\u88dd\u7d00\u9304","description":"\u56e0\u6545\u62ff\u4e86 MacBook Pro 2015 \u91cd\u704c macOS Mojave, \u8a18\u9304\u4e00\u4e0b\u8edf\u9ad4\u5b89\u88dd\u6b77\u7a0b.","date":"2021-02-26T06:05:03.000Z","formattedDate":"2021\u5e742\u670826\u65e5","tags":[{"label":"Mac","permalink":"/moco/blog/tags/mac"},{"label":"kywk","permalink":"/moco/blog/tags/kywk"}],"readingTime":4.465,"hasTruncateMarker":false,"authors":[],"frontMatter":{"sidebar_position":1,"title":"\u7cfb\u7d71\u5b89\u88dd\u7d00\u9304","tags":["Mac","kywk"],"date":"2021-02-26T06:05:03.000Z","images":["https://lh3.googleusercontent.com/pw/ACtC-3cYYtkzJjo_oG7Gzqq8T8XQm4V_qLE3wGWVKOahp6YT4lo-on60NJmjrkkatnizX1b-uID-MCM2ztsXH9z27cMRtql3PA5cpYZYbMfSPuM5Yh3MmqnjnnXYkTg6vtIiBL5SGAQRRAI9zEBIOoyP3tZpuA?authuser=0"],"categories":["mac"]},"prevItem":{"title":"Hello Docusaurus","permalink":"/moco/blog/2022/05/20/move-to-docusaurus"}},"content":"\u56e0\u6545\u62ff\u4e86 MacBook Pro 2015 \u91cd\u704c macOS Mojave, \u8a18\u9304\u4e00\u4e0b\u8edf\u9ad4\u5b89\u88dd\u6b77\u7a0b.\\n\u96a8\u8457\u7db2\u9801\u5de5\u5177\u8d8a\u4f86\u8d8a\u6210\u719f, \u96fb\u8166\u4e0a\u5fc5\u5099\u7684\u5de5\u5177\u5012\u662f\u8d8a\u4f86\u8d8a\u5c11.\\n\\n\u524d\u7f6e\u8edf\u9ad4\\n--------\\n\\n### Homebrew ###\\n\\n__[Homebrew](https://brew.sh/index_zh-tw)__\\n\\nhomebrew cask \u7684\u652f\u63f4\u8d8a\u4f86\u8d8a\u591a, \u8d8a\u4f86\u8d8a\u65b9\u4fbf, \\n\u500b\u4eba\u591a\u6578\u8edf\u9ad4\u90fd\u900f\u904e homebrew \u5b89\u88dd. \\n\u5728\u958b\u59cb\u5b89\u88dd\u5404\u985e\u8edf\u9ad4\u524d, Homebrew \u662f\u5fc5\u8981\u7684.\\n\\n``` shell\\n$ /bin/bash -c \\"$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/HEAD/install.sh)\\"\\n```\\n\\n### Dropbox ###\\n\\n\u6211\u7684\u5c08\u6848\u548c\u8edf\u9ad4\u914d\u7f6e\u6a94\u6848 (.files) \u90fd\u653e\u5728 __[Dropbox](https://www.dropbox.com/)__ \u4e0a, \\n.files \u88e1\u4e5f\u5b58\u4e86\u70ba\u4e86\u65b0\u74b0\u5883\u8a2d\u5b9a\u7684\u7c21\u55ae setup.sh.\\n\u6545\u65b0\u96fb\u8166\u7684\u7b2c\u4e8c\u4ef6\u4e8b\u5c31\u662f\u5b89\u88dd Dropbox Desktop, \u628a\u5de5\u4f5c\u5c08\u6848\u548c\u74b0\u5883\u914d\u7f6e\u540c\u6b65\u5230\u65b0\u96fb\u8166.\\n\\n### Google Chrome ###\\n\\n\u96d6\u5df2\u6f38\u6f38\u68c4\u7528 Chrome, \u6539\u7528 Safari \u548c Edge.\\n\u4f46\u5728 Chrome \u9577\u671f\u4f7f\u7528\u7fd2\u6163, \u4ecd\u7121\u6cd5\u99ac\u4e0a\u6539\u8b8a.\\n\u5c0e\u81f4\u5148\u5b89\u88dd Chrome \u4e5f\u662f\u5b89\u88dd\u7cfb\u7d71\u7684\u5fc5\u5099\u4e4b\u4e00.\\n\\n### Sublime Text ###\\n\\n\u5176\u5be6\u958b\u767c\u7a0b\u5f0f\u7684\u4e3b\u529b\u5df2\u7d93\u8f49\u70ba VSCode, GoLand, WebStorm... \u7b49.\\n\u4f46 Sublime Text \u555f\u52d5\u901f\u5ea6\u5feb, \u57fa\u672c\u4f5c\u696d\u9806\u66a2, \u4ecd\u662f\u6211\u5fc5\u7136\u5b89\u88dd\u7684\u5de5\u5177.\\n\\n\u56e0\u5b89\u88dd\u6642 setup.sh \u53ef\u80fd\u9700\u8981\u4fee\u6539, \\n\u6240\u4ee5\u6703\u5148\u4ee5 Sublime Text \u958b\u555f setup.sh,\\n\u7de8\u6539\u6aa2\u67e5\u5f8c\u518d\u884c\u5b89\u88dd\u5404\u9805\u8edf\u9ad4\u6216\u4f9d\u5b89\u88dd\u60c5\u6cc1\u4fee\u6539\u914d\u7f6e.\\n\\nSublime Text \u5df2\u53ef\u4ee5\u7528 brew \u5b89\u88dd.\\n\\n``` shell\\n$ brew install sublime-text\\n```\\n\\n\\n\u958b\u767c\u5de5\u5177\\n--------\\n\\n__\u53c3\u8003 [macOS \u958b\u767c\u74b0\u5883\u5efa\u69cb](#)__\\n\\n\\n\u751f\u7522\u529b\u5de5\u5177\\n----------\\n\\n### Obsidian ###\\n\\n[Zettelkasten](https://zettelkasten.de/)\\n[Zettlr](https://www.zettlr.com), [Joplin](#), [Trilium Notes](https://github.com/zadam/trilium)\\n\\n``` shell\\n$ brew install --cask obsidian\\n```\\n\\n### Alfred ###\\n\\n__[Alfred](https://goo.gl/mD9K61)__\u985e\u4f3c Spotlight \u7684\u8edf\u9ad4, \u4f46\u529f\u80fd\u9060\u9060\u4e0d\u6b62\u9019\u6a23.\\n\u80fd\u5927\u5927\u6e1b\u5c11\u96e2\u958b\u4f86\u56de\u9375\u76e4\u548c\u89f8\u63a7\u677f\u7684\u6642\u9593, \u53ef\u4ee5\u53c3\u8003[\u9019\u7bc7\u6559\u5b78](https://goo.gl/SHsXkH)\\n\\n``` shell\\n$ brew install --cask alfred\\n```\\n\\n### Itsycal ###\\n\\n__[Itsycal](https://www.mowglii.com/itsycal/)__ \u5728\u529f\u80fd\u8868\u5217\u4e0a\u4fbf\u6377\u5730\u67e5\u770b\u65e5\u66c6, \u53ef\u4ee5\u67e5\u770b\u6708\u66c6\u548c\u4e8b\u4ef6\u5217\u8868, \u9084\u80fd\u5feb\u901f\u5275\u5efa\u65b0\u4e8b\u4ef6.\\n\\n``` shell\\n$ brew install --cask itsycal\\n```\\n\\n### XMind Zen ###\\n\\n\u4e0d\u5f97\u4e0d\u8aaa, \u91cd\u65b0\u958b\u767c\u7684 __[XMind Zen](http://www.xmind.net/)__ \u4e0d\u4f46\u8ddf\u539f\u672c\u7684 XMind \u4e00\u6a23\u597d\u7528,\\n\u800c\u4e14\u66f4\u7f8e\u89c0, \u5feb\u901f. \u503c\u5f97\u66f4\u63db.\\n\\n``` shell\\n$ brew install --cask xmind-zen\\n```\\n\\n\\n\u7db2\u8def\u901a\u8a0a\\n--------\\n\\n### Welly ###\\n\\n[Welly](https://github.com/clyang/welly)  \u662f\u4e00\u5957\u904b\u884c\u5728 Mac \u4e0a\u529f\u80fd\u8c50\u5bcc\u7684BBS\u8edf\u9ad4\\n\\n``` shell\\n$ brew install welly\\n```\\n\\n### CloudMounter ###\\n\\n[CloudMounter](https://cloudmounter.net/) \u628a\u7f51\u7edc\u4e91\u76d8\u653e\u8fdb\u4f60\u7684Finder\u91cc\\n\\n-   [Get From App Store](https://apps.apple.com/tw/app/cloudmounter-cloud-encryption/id1130254674?l=en&mt=12)\\n\\n### rclone ###\\n\\n__[rclone](https://rclone.org/)__\\n\\n``` shell\\n$ brew install rclone\\n```\\n\\n\\n\u5176\u4ed6\\n----\\n\\n### IINA ###\\n\\n[IINA](https://iina.io/) \u662f Mac \u4e0a\u6700\u5f37\u5927\u7684\u64ad\u653e\u5668, \u5e7e\u4e4e\u652f\u63f4\u6240\u6709\u5f71\u97f3\u683c\u5f0f. \u958b\u6e90, UI \u7f8e\u89c0.\\n\\n``` shell\\n$ brew install iina\\n```\\n\\n### ExifRenamer ###\\n\\n__[ExifRenamer](http://goo.gl/lSWZ)__\\n\\n``` shell\\n$ brew install exifrenamer\\n```\\n\\n### McBopomofo \u5c0f\u9ea5\u6ce8\u97f3\u8f38\u5165\u6cd5 ###\\n\\n__[McBopomofo \u5c0f\u9ea5\u6ce8\u97f3\u8f38\u5165\u6cd5](http://mcbopomofo.openvanilla.org/)__ \u53cd\u61c9\u5feb\u901f\uff0c\u8f15\u5de7\u7c21\u55ae, \u70ba Mac User \u91cf\u8eab\u6253\u9020. \\n\u652f\u63f4\u6a19\u6e96\u3001\u501a\u5929\u3001\u8a31\u6c0f\u3001\u501a\u592926 \u9375\u3001IBM \u4ee5\u53ca\u6f22\u8a9e\u62fc\u97f3\u9375\u76e4\u914d\u7f6e\\n\\n-   [\u5c0f\u9ea5\u6ce8\u97f3\u7684\u96b1\u85cf\u8a2d\u5b9a](https://osxchat.tumblr.com/post/29205181318/mcbopomofo-hidden-settings)\\n\\n\\nSee Also\\n--------\\n\\n### \u907a\u73e0 ###\\n\\n\u4ee5\u4e0b\u662f\u66fe\u70ba\u500b\u4eba\u71b1\u611b, \u4f46\u56e0\u6545\u8d8a\u4f86\u8d8a\u5c11\u7528\u7684\u8edf\u9ad4. \u66ab\u5217\u65bc\u6b64...\\n\\n-   [Magnet](https://goo.gl/0Ll1DU)  \\n    \u5206\u5272\u8996\u7a97\u8edf\u9ad4, \u652f\u63f4\u300c\u62d6\u66f3\u8996\u7a97\u5230\u87a2\u5e55\u908a\u754c\u5f8c\u6703\u81ea\u52d5\u5206\u5272\u300d\u7684\u529f\u80fd\\n-   [Typora](https://typora.io/)  \\n    \u57fa\u65bc Markdown \u958b\u6e90\u7684 IDE\\n-   [\u622a\u5716](https://goo.gl/Jwx6Sx)  \\n    \u622a\u5716\u9664\u4e86\u8c50\u5bcc\u7684\u6a19\u8a3b\u5de5\u5177, \u652f\u63f4 QR Code \u8de8\u87a2\u5e55\u50b3\u5716, \u5012\u6578\u8a08\u6642\u622a\u5716, \u6a19\u7c64\u8207\u8cbc\u7d19\u7b49\u529f\u80fd\\n-   [Franz](http://meetfranz.com/)  \\n    \u96c6\u5927\u6210\u7684 IM \u901a\u8a0a\u8edf\u9ad4, \u5728\u540c\u4e00\u500b\u8996\u7a97\u5167\u4f7f\u7528 Slack, Messenger, Telegram, ...\\n-   [Headset](https://headsetapp.co/)  \\n    \u6975\u70ba\u597d\u7528\u7684 Youtube \u514d\u8cbb\u7dda\u4e0a\u97f3\u6a02\u64ad\u653e\u5de5\u5177! \u8c50\u5bcc\u6b4c\u55ae, \u96fb\u53f0\u4ee5\u53ca\u500b\u4eba\u6536\u85cf\u529f\u80fd\\n-   [BarTender3](https://www.macbartender.com/),\\n    [Dozer](https://free.com.tw/dozer-mac/)  \\n    \u6709\u6548\u7ba1\u7406 status bar \u51fa\u73fe\u7684 icon, \u8edf\u9ad4\u4e00\u591a\u5f88\u597d\u7528\\n\\n### Reference ###\\n\\n-   [\u5be6\u7528 Mac Apps \u63a8\u85a6 \u2013 \u9b4f\u5fd7\u8ed2 \u2013 Medium](https://goo.gl/xYCwZa)\\n-   [2018 \u6700\u65b0 MacBook \u5fc5\u88dd\u7a0b\u5f0f\u8207\u8a2d\u5b9a \u2013 Ryan Hsu \u2013 Medium](https://goo.gl/YZfREq)\\n-   [Cask \u8b93 OSX \u5b89\u88dd\u8edf\u9ad4\u66f4\u6709\u6548\u7387 | VISIONCAN](https://goo.gl/Z9BKtx) | [list](https://goo.gl/y7AU5x)"}]}')}}]);